import logo from './logo.svg';
import './App.css';
import React, { useState } from 'react';

function App() {
    const [formState, setFormState] = useState({
      nom: '',
      prenom: '',
      naissance: {
        jour: '',
        mois: '',
        annee: ''
      },
      sexe: '',
      profession: '',
      telephone: ''
    });

    const handleChange = event => {
      const name = event.target.name;
      const value = event.target.value;
      setFormState({
        ...formState,
        [name]: value
      });
    };

    const handleBirthdayChange = event => {
      const name = event.target.name;
      const value = event.target.value;
      setFormState({
        ...formState,
        naissance: {
          ...formState.naissance,
          [name]: value
        }
      });
    };

    return (
      <form className="bg-[#8f4141] w-[400px] flex jus shadow-md rounded px-8 pt-6 pb-8 mb-4">
        <div className="mb-4">
          <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="nom">
            Nom:
          </label>
          <input
            className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
            type="text"
            name="nom"
            value={formState.nom}
            onChange={handleChange}
          />
        </div>
        <div className="mb-4">
          <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="prenom">
            Prénom:
          </label>
          <input
            className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
            type="text"
            name="prenom"
            value={formState.prenom}
            onChange={handleChange}
          />
        </div>
        <div className="mb-4">
          <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="naissance">
            Date de naissance:
          </label>
          <div className="flex items-center">
            <select
              className="shadow appearance-none border rounded w-1/3 py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline mr-2"
              name="jour"
              value={formState.naissance.jour}
              onChange={handleBirthdayChange}
            >
              <option value=""></option>
              <option value="1">1</option>
              <option value="2">2</option>
              ...
              <option value="31">31</option>
            </select>
            <select
              className="shadow appearance-none border rounded w-1/3 py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline mr-2"
              name="mois"
              value={formState.naissance.mois}
              onChange={handleBirthdayChange}
            >
              <option value=""></option>
              <option value="1">Janvier</option>
              <option value="2">Février</option>
              ...
              <option value="12">Décembre</option>
          </select>
          <select
            className="shadow appearance-none border rounded w-1/3 py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
            name="annee"
            value={formState.naissance.annee}
            onChange={handleBirthdayChange}
          >
            <option value=""></option>
            <option value="1900">1900</option>
            <option value="1901">1901</option>
            ...
            <option value="2022">2022</option>
        </select>
      </div>
      </div >
    <div className="mb-4">
      <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="sexe">
        Sexe:
      </label>
      <div className="flex items-center">
        <select
          className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
          name="sexe"
          value={formState.sexe}
          onChange={handleChange}
        >
          <option value=""></option>
          <option value="homme">Homme</option>
          <option value="femme">Femme</option>
      </select>
    </div>
      </div >
      <div className="mb-4">
        <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="profession">
          Profession:
        </label>
        <input
          className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
          type="text"
          name="profession"
          value={formState.profession}
          onChange={handleChange}
        />
      </div>
      <div className="mb-4">
        <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="telephone">
          Numéro de téléphone:
        </label>
        <input
          className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700          leading-tight focus:outline-none focus:shadow-outline"
          type="text"
          name="telephone"
          value={formState.telephone}
          onChange={handleChange}
        />
      </div>
      <div className="flex items-center justify-between">
        <button
          className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline"
          type="submit"
        >
          Envoyer
        </button>
      </div>
    </form >
  );
}

export default App;
